import * as React from 'react';
import {createRoot} from 'react-dom/client';
import 'semantic-ui-css/semantic.min.css';


const App = () => {
    return <h1>Dashboard Page for Frontend Exercise</h1>; // Remove the extra quotes around the text
};

const rootElement = document.getElementById('root');
if (rootElement) {
    const root = createRoot(rootElement); // Create a root using `createRoot`
    root.render(<App />); // Use `root.render` instead of `ReactDOM.render`
} else {
    console.error('Root element not found');
}
